import logo from './logo.svg';
import './App.css';
import { SearchBox } from './components/SearchBox/SearchBox'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Mercado Libre
        </p>
        <SearchBox/>
      </header>
    </div>
  );
}

export default App;
